export default function Card(props) {
    return (
        <div className="Card">
            <h3>{props.name}</h3>
            <img></img>
            <p>{props.activities.map(activity => Details(activity))}</p>
        </div>
    );
}
function Details(activity) {
    return (
        <>
            <p>Position: {activity.position}</p>
            <p>Start: {activity.startDate}</p>
            <p>End: {activity.endDate}</p>
            <p>Location: {activity.location}</p>
            <p>Description: {activity.desc}</p>
        </>       
    );
}
